import React from "react";
import { Container } from "./styles";

export default function Playlist({ playlists }) {
  console.log(playlists);
  return (
    <Container>
      <h1>Suas reproduções em destaque</h1>

      <section>
        <div>
          <img src="" alt="aqui" />

          <title>Top Brasil</title>

          <p>Descrição</p>
        </div>
      </section>
    </Container>
  );
}
